), staging(user_email, recommended_user_email, match_score, match_explanation, algorithm_version, calculated_at) AS (
  SELECT * FROM staging_data
)
INSERT INTO user_match_cache (
  user_id,
  recommended_user_id,
  match_score,
  match_explanation,
  algorithm_version,
  calculated_at,
  created_at,
  updated_at
)
SELECT
  u1.id as user_id,
  u2.id as recommended_user_id,
  staging.match_score,
  staging.match_explanation,
  staging.algorithm_version,
  staging.calculated_at,
  NOW() as created_at,
  NOW() as updated_at
FROM staging
JOIN users u1 ON u1.email = staging.user_email
JOIN users u2 ON u2.email = staging.recommended_user_email;
